BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" (
	"id"	integer NOT NULL,
	"app"	varchar(255) NOT NULL,
	"name"	varchar(255) NOT NULL,
	"applied"	datetime NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_group" (
	"id"	integer NOT NULL,
	"name"	varchar(80) NOT NULL UNIQUE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" (
	"id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_user_groups" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "django_content_type" (
	"id"	integer NOT NULL,
	"app_label"	varchar(100) NOT NULL,
	"model"	varchar(100) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_permission" (
	"id"	integer NOT NULL,
	"content_type_id"	integer NOT NULL,
	"codename"	varchar(100) NOT NULL,
	"name"	varchar(255) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "auth_user" (
	"id"	integer NOT NULL,
	"password"	varchar(128) NOT NULL,
	"last_login"	datetime,
	"is_superuser"	bool NOT NULL,
	"username"	varchar(150) NOT NULL UNIQUE,
	"first_name"	varchar(30) NOT NULL,
	"email"	varchar(254) NOT NULL,
	"is_staff"	bool NOT NULL,
	"is_active"	bool NOT NULL,
	"date_joined"	datetime NOT NULL,
	"last_name"	varchar(150) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "django_session" (
	"session_key"	varchar(40) NOT NULL,
	"session_data"	text NOT NULL,
	"expire_date"	datetime NOT NULL,
	PRIMARY KEY("session_key")
);
CREATE TABLE IF NOT EXISTS "server_location" (
	"id"	integer NOT NULL,
	"city"	varchar(50) NOT NULL,
	"zip"	varchar(50) NOT NULL,
	"state"	varchar(50) NOT NULL,
	"country"	varchar(50) NOT NULL,
	"address"	varchar(50) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_medicalinfo" (
	"id"	integer NOT NULL,
	"bloodType"	varchar(10) NOT NULL,
	"allergy"	varchar(100) NOT NULL,
	"alzheimer"	bool NOT NULL,
	"asthma"	bool NOT NULL,
	"diabetes"	bool NOT NULL,
	"stroke"	bool NOT NULL,
	"comments"	varchar(700) NOT NULL,
	"account_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("account_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "server_medicaltest" (
	"id"	integer NOT NULL,
	"name"	varchar(50) NOT NULL,
	"date"	date NOT NULL,
	"description"	varchar(200) NOT NULL,
	"private"	bool NOT NULL,
	"completed"	bool NOT NULL,
	"image1"	varchar(100),
	"image2"	varchar(100),
	"image3"	varchar(100),
	"image4"	varchar(100),
	"image5"	varchar(100),
	"doctor_id"	integer NOT NULL,
	"hospital_id"	integer NOT NULL,
	"patient_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("patient_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("hospital_id") REFERENCES "server_hospital"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("doctor_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "server_prescription" (
	"id"	integer NOT NULL,
	"date"	date NOT NULL,
	"medication"	varchar(100) NOT NULL,
	"strength"	varchar(30) NOT NULL,
	"instruction"	varchar(200) NOT NULL,
	"refill"	integer NOT NULL,
	"active"	bool NOT NULL,
	"doctor_id"	integer NOT NULL,
	"patient_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("patient_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("doctor_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "server_statistics" (
	"id"	integer NOT NULL,
	"startDate"	date NOT NULL,
	"endDate"	date NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_hospital" (
	"id"	integer NOT NULL,
	"name"	varchar(50) NOT NULL,
	"phone"	varchar(10) NOT NULL,
	"location_id"	integer NOT NULL UNIQUE,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("location_id") REFERENCES "server_location"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE IF NOT EXISTS "server_message" (
	"id"	integer NOT NULL,
	"header"	varchar(300) NOT NULL,
	"body"	varchar(1000) NOT NULL,
	"sender_deleted"	bool NOT NULL,
	"target_deleted"	bool NOT NULL,
	"timestamp"	datetime NOT NULL,
	"sender_id"	integer NOT NULL,
	"target_id"	integer NOT NULL,
	FOREIGN KEY("sender_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("target_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_notification" (
	"id"	integer NOT NULL,
	"message"	varchar(200) NOT NULL,
	"read"	bool NOT NULL,
	"sent_timestamp"	datetime NOT NULL,
	"read_timestamp"	datetime,
	"account_id"	integer NOT NULL,
	FOREIGN KEY("account_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_action" (
	"id"	integer NOT NULL,
	"timePerformed"	datetime NOT NULL,
	"description"	varchar(100) NOT NULL,
	"account_id"	integer NOT NULL,
	"type"	integer NOT NULL,
	FOREIGN KEY("account_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_speciality" (
	"id"	integer NOT NULL,
	"name"	varchar(50) NOT NULL,
	"description"	varchar(100) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_account" (
	"id"	integer NOT NULL,
	"role"	integer NOT NULL,
	"profile_id"	integer NOT NULL UNIQUE,
	"user_id"	integer NOT NULL UNIQUE,
	"archive"	bool NOT NULL,
	FOREIGN KEY("profile_id") REFERENCES "server_profile"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_symptom" (
	"id"	integer NOT NULL,
	"name"	varchar(50) NOT NULL,
	"description"	varchar(100) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "django_admin_log" (
	"id"	integer NOT NULL,
	"action_time"	datetime NOT NULL,
	"object_id"	text,
	"object_repr"	varchar(200) NOT NULL,
	"change_message"	text NOT NULL,
	"content_type_id"	integer,
	"user_id"	integer NOT NULL,
	"action_flag"	smallint unsigned NOT NULL,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_profile" (
	"id"	integer NOT NULL,
	"firstname"	varchar(50) NOT NULL,
	"lastname"	varchar(50) NOT NULL,
	"sex"	varchar(1) NOT NULL,
	"birthday"	date NOT NULL,
	"phone"	varchar(10) NOT NULL,
	"allergies"	varchar(250) NOT NULL,
	"created"	datetime NOT NULL,
	"prefHospital_id"	integer,
	"primaryCareDoctor_id"	integer,
	"speciality_id"	integer,
	FOREIGN KEY("prefHospital_id") REFERENCES "server_hospital"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("speciality_id") REFERENCES "server_speciality"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("primaryCareDoctor_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "server_appointment" (
	"id"	integer NOT NULL,
	"description"	varchar(200) NOT NULL,
	"status"	varchar(50) NOT NULL,
	"startTime"	datetime NOT NULL,
	"endTime"	datetime NOT NULL,
	"doctor_id"	integer NOT NULL,
	"hospital_id"	integer NOT NULL,
	"patient_id"	integer NOT NULL,
	"appointment_type"	varchar(20) NOT NULL,
	"symptom_id"	integer NOT NULL,
	FOREIGN KEY("hospital_id") REFERENCES "server_hospital"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("patient_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("doctor_id") REFERENCES "server_account"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("symptom_id") REFERENCES "server_symptom"("id") DEFERRABLE INITIALLY DEFERRED
);
