INSERT INTO "server_speciality" VALUES (1,'ENT','Ear Nose Throat');
INSERT INTO "server_speciality" VALUES (15,'General Surgery','General surgeons perform gall bladder removals, hernia repairs and some breast and skin surgery.');
INSERT INTO "server_speciality" VALUES (16,'Cardiothoracic Surgery','They often perform heart bypass surgery for blocked arteries, heart valve replacements and remove tumors in the lungs.');
INSERT INTO "server_speciality" VALUES (17,'Vascular Surgery','They often operate on the aorta (main artery in the body), carotid arteries (blood vessels to the brain) and they treat varicose veins in the legs.');
INSERT INTO "server_speciality" VALUES (18,'Cosmetic and Reconstructive Surgery','these ‘plastic’ surgeons perform facial surgery, liposuction and breast surgery, but they are trained in hand surgery as well.');
INSERT INTO "server_speciality" VALUES (19,'Colorectal Surgery','these surgeons operate on hemorrhoids and remove tumors from colon cancer.');
INSERT INTO "server_speciality" VALUES (20,'Surgical Oncology','these surgeons remove all types of tumors throughout the body, so there can be overlap with other surgical specialties.');
INSERT INTO "server_speciality" VALUES (21,'Transplant Surgery','Kidney transplants are the most common, but they also perform liver, heart, lung and pancreas transplants.');
INSERT INTO "server_speciality" VALUES (22,'Trauma Surgery','these surgeons operate on injuries related to ‘penetrating trauma’—which usually means stabbings and gunshot wounds');
INSERT INTO "server_speciality" VALUES (23,'Surgical Endocrinology','these surgeons operate on tumors or growths related to various glands in the body');
INSERT INTO "server_speciality" VALUES (24,'Orthopedic Surgery','Orthopedics are bone and joint doctors');
INSERT INTO "server_speciality" VALUES (25,'Neurosurgery','Neurosurgeons operate on the brain and spinal cord.');
INSERT INTO "server_speciality" VALUES (26,'Urology','Urologists operate on the kidneys, bladder and the male genitals.');
INSERT INTO "server_speciality" VALUES (27,'Neurology','Neurologists are brain and nerve doctors.');
